import React from 'react';
import Container from 'react-bootstrap/Container'
import Accordion from 'react-bootstrap/Accordion'
import Card from 'react-bootstrap/Card'

import berries from './../assets/images/berries.png'
import blueberries from './../assets/images/blueberries.png'

class Post extends React.Component{
  constructor(props) {
    super(props);
    this.state = {
      id: null,
      title: null,
      image: null,
      desc: null,
      tags: []
    };
  }

  render() {
    return (
      <Card className="post">
        <Accordion.Toggle as={Card.Header} eventKey="0">
          <Card.Title>Click me!</Card.Title>
        </Accordion.Toggle>
        <Accordion.Toggle as={Card.Img} eventKey="0" src={berries} />
        <Accordion.Collapse eventKey="0">
          <Accordion.Toggle as={Card.Body} eventKey="0">
            Hello! I'm the body
          </Accordion.Toggle>
        </Accordion.Collapse>
        <Accordion.Toggle as={Card.Footer} eventKey="0">
        </Accordion.Toggle>
      </Card>
    );
  }
}

export default Post
